import './filterbutton.css'

const FilterButton = (props) => {
    return (
        <div>
            <button className="type-button" style={{ backgroundColor: '#A8A878' }} onClick={toggleFilter}>
                <img></img>
                {props.label}
            </button>
        </div>
    )
}

export default FilterButton
